def all_left_right_truncatable_prime(numbers):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    def is_truncatable_prime(n):
        if '0' in str(n):
            return False
        num = str(n)
        while len(num) > 1:
            if not is_prime(int(num)):
                return False
            num = num[1:-1]
        return True

    x = numbers[70]
    result = []
    for num in range(2, x+1):
        if is_truncatable_prime(num):
            result.append(num)
    return sorted(result)
